import Head from "next/head";
import SideBarNav from './SideBarNav';
import TitleBar from './TitleBar';

const Layout = (props) => (
  <div>
    <Head>
      <title>My page title</title>
      <meta
        name="viewport"
        content="initial-scale=1.2, width=device-width"
        key="viewport"
      />
    </Head>
    <SideBarNav {...props} />
    <TitleBar {...props} />
    {props.children}
  </div>
);

export default Layout;
